import React from 'react';
import { Container, AppBar, Typography, Grow, Grid } from '@material-ui/core';
import './styles/Home.css';


export default function Home() {
    return (
        <>
        <div class="jumbotron">
        <Jumbotron fluid>
            <Container>
                <h1>Memories</h1>
            </Container>
        </Jumbotron>
        </div>
            
        </>

    )
}
